import React from 'react'
import { Button, Nav, NavBar, NavLink, NavDropdown, MenuItem, NavbarBrand } from 'react-bootstrap';
import Home from './Home'


class Navbar extends React.Component {



    render() {
        return (
            <Nav>
                <NavBar>
                    <NavLink to="./Home" active>
                        Home
                    </NavLink>
                </NavBar>
            </Nav>
        )
    }
}

export default Navbar
